// Helper function to get ability image URL
export const getAbilityImageUrl = (championId: string, abilityKey: string): string => {
  const filenames = CHAMPION_IMAGE_FILENAMES[championId];
  if (filenames && filenames[abilityKey as keyof typeof filenames]) {
    return `https://ddragon.leagueoflegends.com/cdn/15.17.1/img/spell/${filenames[abilityKey as keyof typeof filenames]}`;
  }
  // Fallback to standard pattern
  return `https://ddragon.leagueoflegends.com/cdn/15.17.1/img/spell/${championId}${abilityKey}.png`;
};

// Helper function to get passive image URL
export const getPassiveImageUrl = (championId: string): string => {
  const filenames = CHAMPION_IMAGE_FILENAMES[championId];
  if (filenames && filenames.passive) {
    return `https://ddragon.leagueoflegends.com/cdn/15.17.1/img/passive/${filenames.passive}`;
  }
  // Fallback to standard pattern
  return `https://ddragon.leagueoflegends.com/cdn/15.17.1/img/passive/${championId}_P.png`;
};
